import React from "react";
import "../GoToUseApplication/Contents.css";

function Contents() {
    return (
        <div className="Container">
            <div className="Contents_list">
                <div className="content-title">3층 실내 활동 공간</div>
                <div className="space-row">
                    <div className="space">댄스 스타즈</div>
                    <div className="space">물림 홀 (다목적실)</div>
                </div>
            </div>
        </div>
    );
}

export default Contents;
